import './App.css';
import DataSummary from './components/DataSummary';

function App() {
  console.log('we are about to list the datasummary');
  const showDataSummary=false;
  return (
    <div className="App">
      <header className="App-header">
        <DataSummary/>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
